// src/components/AddCandidate.js
import React, { useState } from 'react';
import Navbar from './Navbar';
import axios from 'axios';

function AddCandidate() {
  const [formData, setFormData] = useState({
    numero_electeur: '',
    email: '',
    telephone: '',
    parti_politique: '',
    slogan: '',
    photo: '',
    couleur1: '',
    couleur2: '',
    couleur3: '',
    url: '',
  });
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setFormData({...formData, [e.target.name]: e.target.value});
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      const response = await axios.post('http://localhost:8000/candidats/add_candidate.php', formData, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json',
        },
      });
      setMessage(response.data.message);
    } catch (err) {
      setMessage('Error adding candidate.');
    }
  };

  return (
    <div>
      <Navbar />
      <h2>Add Candidate</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Numero Electeur: </label>
          <input type="text" name="numero_electeur" value={formData.numero_electeur} onChange={handleChange} required />
        </div>
        <div>
          <label>Email: </label>
          <input type="email" name="email" value={formData.email} onChange={handleChange} required />
        </div>
        <div>
          <label>Telephone: </label>
          <input type="text" name="telephone" value={formData.telephone} onChange={handleChange} required />
        </div>
        <div>
          <label>Parti Politique: </label>
          <input type="text" name="parti_politique" value={formData.parti_politique} onChange={handleChange} />
        </div>
        <div>
          <label>Slogan: </label>
          <input type="text" name="slogan" value={formData.slogan} onChange={handleChange} />
        </div>
        <div>
          <label>Photo (URL): </label>
          <input type="text" name="photo" value={formData.photo} onChange={handleChange} />
        </div>
        <div>
          <label>Couleur 1: </label>
          <input type="text" name="couleur1" value={formData.couleur1} onChange={handleChange} />
        </div>
        <div>
          <label>Couleur 2: </label>
          <input type="text" name="couleur2" value={formData.couleur2} onChange={handleChange} />
        </div>
        <div>
          <label>Couleur 3: </label>
          <input type="text" name="couleur3" value={formData.couleur3} onChange={handleChange} />
        </div>
        <div>
          <label>URL: </label>
          <input type="text" name="url" value={formData.url} onChange={handleChange} />
        </div>
        <button type="submit">Add Candidate</button>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
}

export default AddCandidate;
